# outer test function
def test_json(value):
	try:
		json.loads(value)
		boolthing = True
	except:
		boolthing = False
	return boolthing

# unit test class 
# currently only checks to make sure the output text is valid json
# will write more robust tests later
class MyTest(unittest.TestCase):
	# getting the dataframe values that will be sent into functions
	lines,polygons,points,blocks,line,polygon = get_data()
	
	# testing the making of lines with the coords field assumed
	def test_lines_both(self):
		value = nl.make_lines(MyTest.lines,'',test=True)
		self.assertEqual(test_json(value),True)

	# testing the making of lines using st_asekwt field
	def test_lines_st(self):
		data = MyTest.lines
		newlist = []
		for row in data.columns.values.tolist():
			if not str(row) == 'coords':
				newlist.append(row)
		data = data[newlist]
		value = nl.make_lines(data,'',test=True)
		self.assertEqual(test_json(value),True)

	# testing the making of polygons
	def test_polygons(self):
		value = nl.make_polygons(MyTest.polygons,'',test=True)
		self.assertEqual(test_json(value),True)

	# testing the making of points
	def test_points(self):
		value = nl.make_points(MyTest.points,'',test=True)
		self.assertEqual(test_json(value),True)

	# tests makings blocks with geohash and cards but assumes geohash first
	def test_blocks_both(self):
		value = nl.make_blocks(MyTest.blocks,'',test=True)
		self.assertEqual(test_json(value),True)

	# tests making blocks with only cardinal NORTH,SOUTH,EAST,WEST headers
	def test_blocks_cards(self):
		data = MyTest.blocks
		newlist = []
		for row in data.columns.values.tolist():
			if not str(row) == 'GEOHASH':
				newlist.append(row)		
		data = data[newlist]
		value = nl.make_blocks(data,'',test=True)
		self.assertEqual(test_json(value),True)

	def test_line(self):
		value = nl.make_line(MyTest.line,'',test=True)
		self.assertEqual(test_json(value),True)

